column8:
弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。2014年から復活発売されたランドクルーザー76/79と、<br>
前後リーフスプリング時代の(HZJ)LXグレード5MT仕様に装着可能な<br>
カップホルダー兼携帯電話ホルダーです<br>
本体裏側に貼り付けられたマジックテープで<br>
純正カーペットに貼り付けるだけで装着完了です。<br>
お好みにより、コルクタイプの<br>
コースターを装着できます。<br>
ブラック仕上げのみ。<br>
送料区分 ： 120<!-- ここから リア受 -->
